import React from 'react';
import {
    Container,
    CityInfo,
    CityTitle,
    NeiborhoodInfo,
    NeiborhoodTitle,
    StreetInfo,
    StreetTitle,
    UfInfo,
    UfTitle,
    dddInfo,
    dddTitle,
    LineContainer
} from './style';


interface IAddress {
    city: string;
    neiborhood?: string;
    street?: string;
    uf?: string;
    ddd?: string;
}

export const Address: React.FC<IAddress> = ({ 
    city,
    neiborhood,
    street,
    uf,
    ddd
}) => {
    return (
        <Container>
            <LineContainer>
                <CityTitle>Cidade</CityTitle>

                <CityInfo>{city}</CityInfo>
            </LineContainer>
        </Container>
    )
}
